import { Planned } from "./components/Planned.tsx";
import { General, Important } from "./components/General.tsx";

function App() {
  const listobj = {
    list2: 2,
    list3: 3,
    list4: 4,
    list5: 5,
  };
  const accountObj = {
    userId: 1,
    accountName: "Dev Reshamiya",
    emailId: "reshamiyadev1234@outlook.com",
    profilePic: "sidebar-tempProfilepic.png",
  };
  const infobarobj = {
    genClass: "infoBar infobar-general",
    name: "Leetcode Weekly",
    steps: null,
    remind: new Date(),
    dueDate: new Date(),
    repeat: { freq: "Weekly", on: ["Mon", "Tue"] },
