    {
      name: "UIUX Course",
      dueDate: new Date(),
      important: false,
      repeat: true,
      completed: true,
      taskID: "1",
    },
  ];
  const tommorow = [
    {
      name: "UIUX Course",
      dueDate: new Date(),
      important: false,
      repeat: true,
      completed: true,
      taskID: "1",
    },
    {
      name: "UIUX Course",
      dueDate: new Date(),
      important: false,
      repeat: true,
      completed: true,
      taskID: "1",
    },
  ];
  const previous = [
    {
      name: "UIUX Course",
      dueDate: new Date(),
      important: false,
      repeat: true,
      completed: true,
      taskID: "1",
    },
    {
      name: "UIUX Course",
      dueDate: new Date(),
      important: false,
      repeat: true,
      completed: true,
      taskID: "1",
    },
    {
      name: "UIUX Course",
      dueDate: new Date(),
      important: false,
      repeat: true,
      completed: true,
      taskID: "1",
    },
  ];
  const Plannedobj = {
    allTask: today,
  };

  return (
    /*<Task
      name="UIUX Course"
      dueDate={new Date()}
      important={false}
      repeat={true}
      completed={true}
      taskID="1"
    />*/
    <div className="todoBody">
      <Sidebar
        genClass="sidebar-general"
        userLists={listobj}
        accountInfo={accountObj}
      />
      <div className="mainContent-general">
        <Important {...Plannedobj} />
      </div>
      <Infobar {...infobarobj} />
    </div>
  );
}

export default App;
